import React from 'react';
import axios from 'axios';

import './item-container.styles.scss'

const ItemContainer = () => {

    axios({
        url: 'items',
        method: 'GET',  
    }).then(response => {
        const items = response.data;
        console.log(items);
    }).catch(error => {
        console.log(error);
    })

    return (
        <div className="container">
            <div className="row">
                {
                    items.map(item => {
                        <h1>item</h1>
                    })
                }
            </div>
        </div>
    )
}

export default ItemContainer;
